// DeleteUniqueIndexCache 删除索引存在的缓存
func (m *MailTemplateRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.MailTemplate) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, m.cache.Key(CacheMailTemplateByConditionPrefix))
	keys = append(keys, m.cache.Key(CacheMailTemplateUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[m.cache.Key(CacheMailTemplateByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailTemplateUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailTemplateByAccountIDPrefix, item.AccountID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailTemplateUnscopedByAccountIDPrefix, item.AccountID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := m.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
